ERROR - 2025-03-16 20:15:47 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xda 0x6e - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('707236', '2025-03-16 19:36', '18', 'Tidak dapat di kaji', 'A: Terpasang ETT no. 3 cm Batas Bibir 7,4 cm (09/3/25), suction di ETT putih kekuningan kental, di mulut putih kental ; B: terintubasi on ventilator Pressure SIMV (rate 40, PIP 17/5 PSV 9 FiO2 48%), SpO2: 80-95%, RR: 48-77x/menit, sore ini  ada brady 4x 65-88x/mnt ,desaturasi 2x 75-85% tidak di rangsang  naik lagi , HR: 144x/menit ; C: CRT kurang dari 3 detik, akral hangat, nadi teraba mulai adekuat, sianosis perifer tidak ada, terpasang PICC premicath di kaki kanan batas 12 cm (11/3/25) terpasang cairan D10/5 NS: 6 cc/jam, Aminosteril Infant: 2cc/jam, Lipid: 1 cc/jam dan iv line di taka(16/3/25) untuk Nacl 0,9n obat, HR: 
 144-152x/menit ; E : edema anasarka berkurang, lebam dan kebiruan seluruh tubuh berkurang, suhu: 37-37,2*C, abdomen tampak supel, bayi tampak ikterik sudah sampai kaki, terdapat luka di tangan kiri mulai mengering ; F: BAB ada 1x konsistensi kuning berhampas, BAK 52 cc/7 jam, Bc: (+) 23,65cc,Diuresis: 6 cc/kgbb/jam, G: terpasang OGT No. 5/40 (10/03/2025) minum AS 12 cc/3 jam , BBL: 1290 gr, BBS: 1.270 gram, LP 20cm. Hasil lab pagi ini HB : 9.1, HT: 26, Leukosit : 10.3, Trombosit : 369, PT : 11.8, APTT : 29.2, GDS : 95, Biltot : 10.53, Bil Direk 0.62, Bil Indirek : 9.91.
', 'Gangguan ventilasi spontan ,Menyusui tidak efektif
', 'Setelah dilakukan tindakan keperawatan selama 7x24 jam diharapakan ventilasi spontan meningkat dengan kriteria hasil: penggunaan otot bantu nafas menurun, gelisah menurun, dispneu menurun, takikardi membaik, PO2 membaik; Setelah dilakukan perawatan 7x24 jam diharapkan status menyusui membaik dengan kriteria hasil : Perlekatan bayi pada payudara ibu meningkat, Kemampuan ibu memposisikan bayi meningkat, Hisapan bayi meningkat, Bayi rewel menurun. Setelah diIakukan intervensi selama 2x24 jam diharapkan intregritas kulit dan jaringan meningkat dengan Kriteria Hasil: Elastisitas meningkat, Perfusi jaringan meningkat, Kerusakan lapisan kulit menurun, Pigmentasi abnormal menurun.
', '', '', '', '', '', '', '', '', '1679', '1', 'Intervensi Keperawatan: Monitor adanya kelelahan otot bantu nafas, Monitor status respirasi dan oksigenisasi, Pertahankan kepatenan jalan nafas, Bantu untuk merubah posisi jika diperlukan, Lakukan auskultasi bunyi pernafasan secara teratur, Identifikasi keadaan emosional ibu saat akan dilakukan konseling menyusui, Identifikasi keinginan dan tujuan menyusui, Identifikasi permasalahan yang ibu alami selama proses menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu, Monitor tanda tanda vital bayi (terutama suhu 36,5- 37,5 derajat celcius), Identifikasi status kesehatan neonatus, Monitor kesadaran/status neurologis, kardiovaskuler, pernafasan, suhu, warna kulit, atau Spo2 dengan mengunakan formulir Newborn Earting Warning System &#40;NEWS&#41;, Atur interval waktu pemantauan sesuai dengan kondisi neonatus.<div>Kolaborasi: post tranfusi FFP 2 kali selesai terakhir 13/03/25 jam 00.30, weaning setting venti bertahap, minum 10-12 cc/3jam, R/ konsul jantung-> R/ echo jika dr. Ika Sp. Jp visite , R/ transfusi PRC 15 cc ( ada di Bank darah namun hasilnya tidak match --&gt; incompetible minor 2+), sedang cek GDT --&gt; tunggu hasil.</div>', NULL, '1679', 0, NULL, '2025-03-16 20:15:47')
